import * as types from "./actionTypes"
import axios from "axios";

const API = "http://localhost:5000"

const getDocs = (docs) => ({
    type: types.GET_DOCS,
    payload:docs
});

export const loadDocs = () => {
    return function(dispatch) {
        axios.get(`${API}/users`)
        .then((resp) => dispatch(getDocs.data))
        .catch((err) => console.log("error:", err))
    }
}
